(function () {
  "use strict";

  let removeAds, removeAd, isAd, isNotAd;

  const consoleStyle = "background-color: darkblue; color: white;";
  const adStyle = "background-color: darkred; color: white;";

  isAd = (article, debug) => {
    const suggested = article.textContent.includes("Suggested for you");
    if (suggested) {
      if (debug) {
        console.log("Suggested for you, ad");
      }
      return true;
    }
    const sponsoredLabel =
      article.querySelector("[aria-label=Sponsored]") != null;
    if (sponsoredLabel) {
      if (debug) {
        console.log("Aria label Sponsored, ad");
      }
      return true;
    }
    const id = (article.getAttribute("aria-describedby") || "").split(" ")[0];
    if (id == null || id === "") {
      return false;
    }
    const describedBy = article.querySelector(`#${id}`);
    if (describedBy == null) {
      if (debug) {
        console.log("Aria describedby missing, not an ad");
      }
      return false;
    }
    if (describedBy.textContent.includes("Sponsored")) {
      if (debug) {
        console.log("Aria describedby includes Sponsored, ad");
      }
      return true;
    }
    const flexParent = describedBy.querySelector("[style*=flex]");
    if (flexParent == null) {
      if (debug) {
        console.log("No flex parent, not an ad");
      }
      return false;
    }

    const map = new Map();
    Array.from(flexParent.childNodes).forEach((c) => {
      const s = getComputedStyle(c);
      if (s.width !== "0px" && s.height !== "0px") {
        const t = s.top;
        if (!map.has(t)) {
          map.set(t, []);
        }
        const a = map.get(t);
        const text = c.textContent;
        a.push(text);
      }
    });

    const values = Array.from(map.values());
    const hiddenSponsored =
      values.map((x) => x.sort().join("")).indexOf("Sdenooprs") !== -1;
    if (hiddenSponsored && debug) {
      console.log("Aria describedby has hidden word Sponsored, ad");
    }

    return hiddenSponsored;
  };

  window.fbIsAd = (a) => {
    return isAd(a, true);
  };

  removeAd = (article, debug = false) => {
    let ad = undefined;
    const h4 = article.querySelector("h4");
    const title = h4 && h4.textContent;
    ad = isAd(article, debug);
    console.log("%cFacebook Ad?", ad ? adStyle : consoleStyle, {
      title,
      article,
      ad,
    });
    if (ad === true) {
      article.parentNode.removeChild(article);
      if (window.count == null) {
        window.count = 0;
      }
      window.count += 1;
    } else {
      article.setAttribute("data-checked", "true");
    }
  };

  window.fbRemoveAd = (a) => {
    return removeAd(a, true);
  };

  removeAds = (debug = false) => {
    let articles;
    if (debug) {
      console.log("-----");
      articles = document.querySelectorAll(
        "[role=feed] [role=article][aria-describedby]"
      );
    } else {
      articles = document.querySelectorAll(
        "[role=feed] [role=article][aria-describedby]:not([data-checked])"
      );
    }
    articles.forEach((article) => {
      removeAd(article, debug);
    });
  };

  window.fbRemoveAds = () => {
    return removeAds(true);
  };

  window.count = 0;

  removeAds(true);

  const mutationObserverConfig = {
    attributes: false,
    childList: true,
    subtree: true,
  };

  const callback = (_mutList, _obs) => {
    observer.disconnect();
    removeAds();
    observer.observe(document, mutationObserverConfig);
  };

  const observer = new MutationObserver(callback);
  observer.observe(document.querySelector("body"), mutationObserverConfig);
})();

